import React, { Component } from "react";
import Input from "../../general/Input";
export default class Addproduct extends Component {
  render() {
    return (
      <div>
        <h1>Addproduct</h1>
        <Input
          type="text"
          placeholder="name"
          name={name}
          value={value}
          onChange={onChange}
        />
      </div>
    );
  }
}
